import React from 'react';
import Card from './Card';
import { render } from '@testing-library/react';

const CardList = ({robots}) => {
    render() 
    return (
        <React.StrictMode>
            {
                robots.map((user, i) => {
                    return (
                        <div>
                            <Card 
                            id={robots[i].id} 
                            name={robots[i].name} 
                            email={robots[i].email} 
                            />
                        </div>
                    );
                })
            }
      </React.StrictMode>
    )
}

export default CardList;
